import React from 'react';
import './HomePage.css';
import {Button} from "../Button/Button";

function HomePage() {
    return (
        <div className='hero-container'>
            <video src='../../videos/Introducing-the-new-MacBook-Air-Apple.mp4' autoPlay loop muted/>
            <h1>DigiShop</h1>
            <p>What you desire</p>
            <div className='hero-btns'>

                <Button className='btns'
                        buttonStyle='btn--outline'
                        buttonSize='btn--large'>New Collection</Button>

                <Button className='btns'
                        buttonStyle='btn--primary'
                        buttonSize='btn--large'>Watch Trailer
                    <i className='far -play-circle'/>
                </Button>
            </div>
        </div>
    );
}

export default HomePage;
